import React, {useState, useEffect, Component} from 'react';
import './App.css';

const Streamer = ({urlData}) => {
  return(
    urlData.length
  );
}

function App() {
  const [initialData, setInitialData] = useState([])

  useEffect(() => {
    fetch('/api').then(response => {
        if(response.status === 200){
          return response.json()
        }
      }).then(data => setInitialData(data.data))
  }, []);
    console.log(initialData[3])
    var streamers = initialData[0];
    var categories = initialData[1];
    var dramaCount = initialData[2];
    var urls = initialData[3];

    if(streamers !== undefined && categories !== undefined && dramaCount !== undefined && urls !== undefined ){
      return(
      <div className="App">
          {urls.length}
        </div>
      );
    } 
    else{
      return(
        <div className="App">
        </div>
      );
    }
}

export default App;
